import UIKit

func strStr(_ haystack: String, _ needle: String) -> Int {
    guard needle != "" else { return 0 }
    
    var dict = [String: Int]()
    
    var i = haystack.count
    var start = i - needle.count
    
    while start >= 0  {
        let left =  haystack.index(haystack.startIndex, offsetBy: start)
        let right = haystack.index(haystack.startIndex, offsetBy: i)
        
        let subString = String(haystack[left..<right])
        dict[subString] = start
        
        i -= 1
        start -= 1
    }
    
    return dict[needle] ?? -1
}

strStr("", "")
